// script.js

const categorySelect = document.getElementById('category-select');
const minPriceInput = document.getElementById('min-price');
const maxPriceInput = document.getElementById('max-price');
const recentDataTable = document.getElementById('recent-data-table');

// populate recent data table with sample data
const recentData = [
    { name: 'John Doe', email: 'john@example.com', age: 30, location: 'New York', price: 499 },
    { name: 'Jane Smith', email: 'jane@example.com', age: 25, location: 'London', price: 999 },
    { name: 'Jim Brown', email: 'jim@example.com', age: 40, location: 'Tokyo', price: 120 }
];

recentDataTable.innerHTML = '';
recentData.forEach((data) => {
    const row = document.createElement('tr');
    row.innerHTML = `
        <td>${data.name}</td>
        <td>${data.email}</td>
        <td>${data.age}</td>
        <td>${data.location}</td>
        <td>${data.price}</td>
    `;
    recentDataTable.tBodies[0].appendChild(row);
});

// add event listener to apply filters button
document.querySelector('form button').addEventListener('click', (e) => {
    e.preventDefault();
    const category = categorySelect.value;
    const minPrice = parseInt(minPriceInput.value);
    const maxPrice = parseInt(maxPriceInput.value);
    // filter data based on selected category and price range
    const filteredData = recentData.filter((data) => {
        return data.category === category && data.price >= minPrice && data.price <= maxPrice;
    });
    // update recent data table with filtered data
    recentDataTable.innerHTML = '';
    filteredData.forEach((data) => {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td>${data.name}</td>
            <td>${data.email}</td>
            <td>${data.age}</td>
            <td>${data.location}</td>
            <td>${data.price}</td>
        `;
        recentDataTable.tBodies[0].appendChild(row);
    });
});
